        5324: function (o, e) {
            o.exports = '<h1>996.ICU</h1>\n<h2>Что такое 996?</h2>\n<p>Данное число обозначает неофициальный распорядок трудового дня (с 9 часов утра до 9 часов вечера), которые постепенно набирает популярность в Китае. Работа в компании, которая поощряет график &quot;996&quot; предполагает работу в течении не менее 60 часов в неделю. </p>\n<h2>Выдержки из трудового кодекса КНР</h2>\n<p>Цитата из <a href="http://www.china.org.cn/living_in_china/abc/2009-07/15/content_18140508.htm">трудового законодательства Китайской Народной Республики</a> статьи 36 гласит:</p>\n<blockquote>\n<p>Государством вводится рабочий график, при котором полная продолжительность рабочего времени работника не должна превышать 8 часов в день и 44 часов в неделю.</p>\n</blockquote>\n<p>Статья 39:</p>\n<blockquote>\n<p>Если предприятие не способно сдедовать указаниям Статьи 36 и 38 данного закона, он может следовать иным правилам труда и отдыха с соглашения административного отдела по труду.</p>\n</blockquote>\n<p>Статья 41:</p>\n<blockquote>\n<p>Работодатель может продлить количество рабочих часов, при необходимости производства или предприятия после консультации с профсоюзом и рабочими. Продление рабочего дня не должно превышать один час в день, или не более трёх часов в день, если данное продление вызвано особыми причинами, и при условии гарантии сохранности здоровья рабочих. Общее время продления рабочего дня не должно превышать 36 часов в месяц.</p>\n</blockquote>\n<p>Статья 43:</p>\n<blockquote>\n<p>Работодатель не может продлевать рабочие часы своих работников с нарушениями условий данного закона</p>\n</blockquote>\n<p>Статья 90:</p>\n<blockquote>\n<p>Если работодатель продлевает рабочие часы, нарушая условия данного законодательства, административные отделы по труду могут выдать предупреждение, приказать исправить и наложить штраф.</p>\n</blockquote>\n<p>Статья 91: </p>\n<blockquote>\n<p>Работодатель, связанный с одним из следующих случаем, которые посягают на законные права и интересы работников, будет потребован выплатить рабочим пересчитанную зарплату, а также потребован выплатить компенсацию  административным отделом по труду в каждом из следующих случаев:</p>\n<p>(1) Необоснованное снижени или задержка заработной платы; (2) Отказ оплачивать пересчитанную заработную плату за работу продлённое рабочее время; (3) Выплата зарплат, меньше местных условий или минимума; (4) Непредоставление экономической компенсации рабочим в соостветствии с данным законодательством после разрыва трудового договора.</p>\n</blockquote>\n<h2>Рост популярности графика 996</h2>\n<p>В начале 2019 года, китайская фирма электронной коммерции объявили о принятии &quot;996&quot; график работы в будущем, на праздновании юбилея компании. Генеральный директор youzan ответил: &quot;Это, несомненно, будет хорошим решением, когда мы посмотрим [на результат данной практики] через несколько лет&quot;.\nВ середине марта 2019 года, сообщалось, что JD.com начал принимать &quot;996&quot; или &quot;995&quot; график работы в некоторых из бизнес - подразделений. JD.com PR размещать в своих аккаутах деловой социальной сети следующее: &quot;[нашей культурой является] нераздельное посвещение [достижению целей компании]&quot;.\nНесмотря на недавное предание огласке, данный &quot;секрет&quot; известен и применяется многочисленными китайскими компаниями.\nхотя он набирает более широко, в последнее время эта работа scheudle является известным &quot;секрет&quot; практикуется в большом количестве китайских компаний.</p>\n<h2>Вознаграждения, пособия, льготы</h2>\n<p>В соответствии с трудовым законодательством, работники, которые следуют графику работы &quot;996&quot; заслуживают повышение заработной платы в 2.275 раза относительно их базового оклада. К сожалению, люди, работающие в формате &quot;996&quot;, редко получают соответствующие суммы за переработку.</p>\n<h2>Что обозначает название 996.ICU?</h2>\n<p>Постоянная работа в режиме &quot;996&quot; обеспечивает риск разработчика на путёвку в отделение интенсивной терапии(<strong>I</strong>ntencive <strong>C</strong>are <strong>U</strong>nit).</p>\n<p><strong>Developer&#39;s lives matter.</strong></p>\n<p>Эта страница является зеркальным отражением 996.ICU для духовной поддержки @vivien8261 Github</p>\n'
        },
